import { BrowserRouter, Routes } from 'react-router-dom';
import './App.css';
import AddEmployee from './component/AddEmployee';
import NavigationBar from './component/NavigationBar';



function App() {
    return
     <>
    <BrowserRouter>
      <NavigationBar/>
      <Routes>
      <AddEmployee />
      </Routes>
    </BrowserRouter>
    </>
};

export default App;
